for(var regionName in regions) {
    (function (region) {
        if (region.href) {
            // Set href, title, style Ginco and hover effect

            region.path.attr({title: region.title});
            region.path[0].addEventListener("click", function() {
                window.open(region.href, '_blank');
            }, true);

            region.path.attr(region.style);

            region.path[0].addEventListener("mouseover", function() {
                region.path.animate(hoverStyle, animationSpeed);
            }, true);
            region.path[0].addEventListener("mouseout", function() {
                region.path.animate(region.style, animationSpeed);
            }, true);
        }
        else {
            // Set a gray neutral style, that's all
            region.path.attr(styleNeutral);
        }

    })(regions[regionName]);
}